import { ColumnNumber, FirstColumn } from "./Table.style";
import { DataGrid } from "@mui/x-data-grid";
export const Table = () => {
  return (
    <>
      <table
        style={{
          borderRadius: "10px",
          // border: "1px solid black",
          margin: "20px",
          padding: 0,
          borderCollapse: "collapse",
        }}>
        <div
          style={{
            borderRadius: "inherit",
            boxSizing: "border-box",
            width: "100%",
          }}>
          <thead style={{ background: "#FAFAFA" }}>
            <tr>
              <th style={{ borderTopLeftRadius: "10px" }}>
                {" "}
                <FirstColumn />
              </th>

              <th>№ договора</th>

              <th>Дата создания</th>
              <th>Дата окончания</th>
              <th>Комментарии</th>
              <th>Статус</th>
              <th style={{ borderTopRightRadius: "10px" }}>Действие</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>treer</td>
            </tr>
          </tbody>
        </div>
      </table>
    </>
  );
};
